winning_msg: .asciiz	"You win!\n\n"
item_msg:   .asciiz	"Item grabbed\n"
hit_msg:    .asciiz	"Player hit!!!\n"
.text
.globl MAIN
MAIN:
	la $a0, menu_screen
	jal DRAW_MAP
menu:	lw $t9,  0xffff0000	# detect press
	bne $t9, 1, menu
	lw $t9, 0xffff0004
	bne $t9, 0x70, menu	# only when player pressed p, the game starts
	
reset:	# Set level objectives
	lw $t9, item_arr
	sw $t9, objectives
	
	# Set initial player health
	li $t9, 3
	sw $t9, player_lives
	
	# Initialize/reset item flags
	lw $t8, item_arr
	la $t9, item_arr+4
item_init_loop:
	beqz $t8, enemy_init
	lw $t7, 4($t9)
	ori $t7, 1
	sw $t7, 4($t9)
	sub $t8, $t8, 1
	addi $t9, $t9, 8
	j item_init_loop
	
	# Initialize/reset enemy flags
enemy_init:
	lw $t8, enemy_arr
	la $t9, enemy_arr+4
enemy_init_loop:	# Initialize enemies flag
	beqz $t8, respawn
	lw $t7, 4($t9)
	ori $t7, 1
	sw $t7, 4($t9)
	sub $t8, $t8, 1
	addi $t9, $t9, 12
	j enemy_init_loop
	
respawn:# Draw map and get initial player position
	la $a0, map1
	jal DRAW_MAP
	lw $t9, player_lives
	addi $a0, $t9, -1
	li $a1, 0
	jal UPDATE_DISPLAY
	
clear_bullets:	# Clear bullet
	li $t9, 0
	sw $t9, bullet_arr
	
init_values:
	# Init values for movement
	li $s6, 0	# vel.x
	li $s7, 0	# vel.y
	li $s3, 0	# Walled
	li $s4, 0	# isGrounded
	li $s5, EXTRA_JUMPS
	li $s2, 1	# xfacing
	li $s1, 0	# Dash
	li $s0, 3	# 
	
game_loop:
	# Get key input
	bgtz $s1, update	# If player is dashing, no keyboard input is detected
	lw $t9,  0xffff0000	# detect press
	beq $t9, 1, key_pressed
	j update
	
key_pressed:
	# get pressed key
	lw $t9, 0xffff0004	
	beq $t9, 0x77, w_pressed
	beq $t9, 0x61, a_pressed
	beq $t9, 0x73, s_pressed
	beq $t9, 0x64, d_pressed
	beq $t9, 0x20, space_pressed
	beq $t9, 0x41, A_pressed
	beq $t9, 0x44, D_pressed
	beq $t9, 0x78, x_pressed
	beq $t9, 0x70, p_pressed
	beq $t9, 0x6A, j_pressed
	# Unknown key detected
	j update

space_pressed:	# Jump / Double jump
	beqz $s4, check_wall_jumping
	li $s7, JUMP
	li $s4, 0
	j update
	check_wall_jumping:
		beqz $s3, check_extra_jumps
		li $s7, JUMP
		li $s3, 0		# cancel wall hang
		j update
	check_extra_jumps:
		beqz $s5, update	# no more jumping if there is no more extra jump
		li $s7, JUMP
		addi $s5, $s5, -1
		j update
p_pressed:	# Restart
	j reset
x_pressed:	# Exit
	j end_game
A_pressed:	# Dash left
	blt $s1, -1, a_pressed 	# Cannot dash if in cooldown, treat as walk left
	li $s2, -1
	sll $s6, $s2, DASH
	li $s7, 0
	li $s1, DASH_FRAME
	j update
D_pressed:	# Dash right
	blt $s1, -1, d_pressed	# Cannot dash if in cooldown, treat as walk right
	li $s2, 1
	sll $s6, $s2, DASH
	li $s7, 0
	li $s1, DASH_FRAME
	j update
d_pressed:	# Toggle Right
	bgtz $s6, going_right
	li $s2, 1
	sll $s6, $s2, WALK
	j update
	going_right:	# player already going right
		li $s6, 0
		j update

a_pressed:	# Toogle Left
	bltz $s6, going_left
	li $s2, -1
	sll $s6, $s2, WALK
	j update
	going_left:	# player already going left
		li $s6, 0
		j update
w_pressed:	# Look up
	j update
s_pressed:	# Look Down
	j update
j_pressed:	# Shoot
	lw $t0, player_pos+4
	lw $t1, player_pos
	la $t2, framebuffer
	sll $a0, $t0, 7
	add $a0, $a0, $t1
	move $a1, $s2
	# choose offset by facing direction
	shoot_right:
		beq $s2, -1, shoot_left
		addi $a0, $a0, BULLET_PLAYER_RIGHT 
		j shoot_check_wall
	shoot_left:
		addi $a0, $a0, BULLET_PLAYER_LEFT
	shoot_check_wall:
		sll $t3, $a0, 2
		add $t2, $t2, $t3
		lw $t2, 0($t2)
		beq $t2, BORDER, update
	shoot:	jal ADD_BULLET
	
update: 
	# Update Bullets
	li $a0, BACKGROUND
	jal DRAW_BULLETS	# clear the last frame's bullets
	jal UPDATE_BULLETS
	jal DELETE_BULLETS
	
	# Enemy shooting
	jal ENEMY_SHOOT
	
	# delete the old player
	lw $a0, player_pos
	lw $a1, player_pos+4
	li $a2, PLAYER_WIDTH
	li $a3, PLAYER_HEIGHT
	li $t9, 0xff000000
	li $t8, BACKGROUND
	li $t7, 0
	addi $sp, $sp, -12
	sw $t7, 0($sp)
	sw $t8, 4($sp)
	sw $t9, 8($sp)
	jal DRAW_RECT
	
	# Check celing collision
ceil:	move $a0, $s7
	jal CEIL_COLLISION
	move $s7, $v0
	
	# Check wall collision
wall:	move $a0, $s6
	move $a1, $s7
	move $a2, $s3
	jal X_COLLISION
	move $s6, $v0
	move $s3, $v1
	
	# check ground collision
ground:	move $a0, $s7
	move $a1, $s6
	jal GROUND_COLLISION
	move $s7, $v0
	move $s4, $v1
	beqz $s4, new_pos
	li $s5, EXTRA_JUMPS
	li $s3, 0	# no wall hanging on the ground
	
new_pos:	# Update player pos
	lw $t1, player_pos	# player x
	lw $t2, player_pos+4	# player y
	add $t1, $t1, $s6
	add $t2, $t2, $s7
	
	# Update dash
	blez $s1, not_dashing		# If player is dashing
	subi $s1, $s1, 1			# decrement dash frame
	bgtz $s1, store				# If DASH goes to 0, set reset vel.X and set dash cooldown
	li $s1, DASH_COOLDOWN
	li $s6, 0
	j store
not_dashing:			# Player is not dashing
	beq $s1, -1, wall_hang
	addi $s1, $s1, 1
	
wall_hang: # Check wall hang
	beqz $s3, gravity	# If walled > 0 and not touching ground and player is falling -> wall hang
	beq $s4, 1, gravity
	li $s6, 0
	li $s7, 0
	li $s5, EXTRA_JUMPS
	j store
	
gravity:   # Calculate vel.y for next frame
	bge $s7, GRAV_TERM, store
	addi $s7, $s7, GRAV_CONST

store:	sw $t1, player_pos	# Store player position.
	sw $t2, player_pos+4
	
draw:	# Draw door
	lw $a0, door_pos
	lw $a1, door_pos+4
	li $a2, DOOR_WIDTH
	li $a3, DOOR_HEIGHT
	li $t9, 0xdd000000
	la $t8, door_sprite
	lw $t6, objectives
	bgtz $t6, draw_closed_door
	addi $t8, $t8, 308
	draw_closed_door:
	li $t7, 1
	addi $sp, $sp, -12
	sw $t7, 0($sp)
	sw $t8, 4($sp)
	sw $t9, 8($sp)
	jal DRAW_RECT
	
	# Draw items
	jal DRAW_ITEMS
	
	# Draw enemies
	jal DRAW_ENEMIES
	
	# Draw Bullets
	li $a0, BULLET
	jal DRAW_BULLETS

	#Draw Player
	lw $a0, player_pos
	lw $a1, player_pos+4
	li $a2, PLAYER_WIDTH
	li $a3, PLAYER_HEIGHT
	li $t9, 0xee000000
	li $t7, 1
	
	beqz $s6, player_hang
		la $t8, player_run_sprite
		j draw_player_right
	player_hang:
	beqz $s3, player_standing
		la $t8, player_hang_sprite
		j draw_player_right
	player_standing:	
		la $t8, player_sprite
draw_player_right:
	bltz $s2, draw_player_left
	addi $t8, $t8, 160
draw_player_left:
	addi $sp, $sp, -12
	sw $t7, 0($sp)
	sw $t8, 4($sp)
	sw $t9, 8($sp)
	jal DRAW_RECT
	
	# Sleep
	li $v0, 32
	li $a0, SLP_TIME
	syscall
	
	j game_loop

end_game:
	li $v0, 10
	syscall
	
#####################################################################
DRAW_RECT:	# Draw rectangle
	# Parameters:
	# $a0 = posx; $a1 = posy; $a2 = width; $a3 = height
	# stack order: mode, colour/sprite address, leading flag.
	la $t0, framebuffer
	mul $t1, $a2, $a3	# player area (act as iterator)
	lw $t4, 0($sp)		# Load fill type
	lw $t3, 4($sp)		# Load fill colour/ sprite
	lw $t5, 8($sp)		# Load leading flag
	addi $sp, $sp, 12	# 
	
	# calculate top left position
	sll $a1, $a1, 7		# $a1 = 128y
	add $a1, $a1, $a0	# $a1 = 128y + x
	sll $a1, $a1, 2		# $a1 = (128y + x)* 4
	add $t0, $t0, $a1	# $t0 = framebuffer + (128y + x)* 4
	# calculate spacing to get to next line
	li $t2, 129     	# $t2 = screen_width + 1
	sub $t2, $t2, $a2 	# $t2 = (screen_width + 1 - width)
	sll $t2, $t2, 2		# $t2 = (screen_width + 1 - width)*4
	
	beqz $t4, draw_fill
draw_sprite:	# draw froma a sprite
draw_sprite_loop:
	lw $t7, 0($t3)		# load fill color
	addi $t3, $t3, 4	# increment for next load
	beqz $t7, skip_pixel	# skip pixel if color is 0x0
	andi $t7, $t7, 0x00ffffff	# unset leading byte
	or $t7, $t7, $t5		# give color the leading flag
	sw $t7, 0($t0)
skip_pixel:
	addi $t1, $t1, -1	# decrement iterator 
	beqz $t1, exit_loop
	div $t1, $a2		
	mfhi $t6		# $t6 = $t1 % $a2
	beqz $t6, next_y1	
	addi $t0, $t0, 4	# Case: new pixel is on the next to old pixel
	j draw_sprite_loop
next_y1: add $t0, $t0, $t2	# Case: new pixel is on the next line.
	j draw_sprite_loop
	
draw_fill:	# fill a solid colour
	andi $t3, $t3, 0x00ffffff	# unset leading byte
	or $t3, $t3, $t5		# give color the leading flag
draw_fill_loop:
	sw $t3, 0($t0)		# draw pixel
	addi $t1, $t1, -1	# decrement iterator 
	beqz $t1, exit_loop
	div $t1, $a2		
	mfhi $t6		# $t6 = $t1 % $a2
	beqz $t6, next_y2	
	addi $t0, $t0, 4	# Case: new pixel is on the next to old pixel
	j draw_fill_loop
next_y2: add $t0, $t0, $t2	# Case: new pixel is on the next line.
	j draw_fill_loop

exit_loop:
	jr $ra	# Return to caller

#####################################################################	
X_COLLISION:
	# Parameters: $a0: x velocities	 $a1: y velocities   $a2: current wall flag
	# Return value: $v0: new x velocity	$v1: wall collision
	bnez $a0, moving	# return the same velocity and no collision if player not moving
	move $v0, $a0
	move $v1, $a2
	jr $ra
moving: la $t0, framebuffer
	li $t1, 0
	li $t2, 0
	move $t3, $a0
	li $t4, PLAYER_HEIGHT
	li $t5, 1		# dir
	# Calculate starting position
	lw $t9, player_pos+4	# $t9 = player_y
	sll $t9, $t9, 9		# $t9 = player_y*128*4
	add $t0, $t0, $t9	# St0 = player_y*128*4
	
	bgez $a1, x_comp
	sll $t9, $a1, 9
	add $t0, $t0, $t9
	
x_comp:	lw $t9, player_pos	# $t9 = player_x
	bgtz $a0, right
left:	
	addi $t9, $t9, -1		# $t9 = (player_x - 1)
	sll $t9, $t9, 2			# $t9 = (player_x -1)*4
	add $t0, $t0, $t9		# St0 = player_y*128*4 + (player_x -1)*4
	li $t5, -1
	j t6
right:	
	addi $t9, $t9, PLAYER_WIDTH	# $t9 = player_x + player_width
	sll $t9, $t9, 2			# $t9 = (player_x + player_width)*4
	add $t0, $t0, $t9		# St0 = player_y*128*4 + (player_x + player_width)*4

t6:	move $t6, $t0
check_loop:
	beq $t1, $t3, no_wall_collision
	
inner_loop:	bge $t2, $t4, one_pass
		# Check for pixel collision
		lw $t7, 0($t6)
		bne $t7, BORDER, not_border
		# Collision with border found, return new vel.x and set collision flag
		move $v0, $t1
		beq $a2, 1, cancel_wall_hang	# If the player is already wall hanging, cancel wall hang
		li $v1, 1
		# invert xfacing diretion while on wall
		bltz $s2, invert_left
		li $s2, -1
		j early_ret
	invert_left:
		li $s2, 1
		j early_ret
cancel_wall_hang:		
		li $v1, 0 
early_ret:	jr $ra

not_border:	# If collided pixel is not border
		beq $t7, BACKGROUND, next_p	# If collided pixel is not background
		# Store used registers ($a0, $t0, $t1, $t2, $t3, $t4, $t5, $t6, $ra)
		addi $sp, $sp, -36
		sw $a0, 0($sp)
		sw $t0, 4($sp)
		sw $t1, 8($sp)
		sw $t2, 12($sp)
		sw $t3, 16($sp)
		sw $t4, 20($sp)
		sw $t5, 24($sp)
		sw $t6, 28($sp)
		sw $ra, 32($sp)
		# Call other collision handler
		move $a0, $t6
		jal OTHER_COLLISION
		# Restore used registers
		lw $a0, 0($sp)
		lw $t0, 4($sp)
		lw $t1, 8($sp)
		lw $t2, 12($sp)
		lw $t3, 16($sp)
		lw $t4, 20($sp)
		lw $t5, 24($sp)
		lw $t6, 28($sp)
		lw $ra, 32($sp)
		addi $sp, $sp, 36
		
next_p: 	addi $t6, $t6, 512	# move one pixels down (128*4)
		addi $t2, $t2, 1	# height_count += 1
		j inner_loop
one_pass: 	
	add $t1, $t1, $t5	# $t1 = $t1 + dir
	li $t2, 0		# reset value of $t2 to 0
	sll $t7, $t1, 2		# $t7 = $t1*4
	add $t6, $t0, $t7	# $t6 = $t0 + $t7
	j check_loop
no_wall_collision:
	# Return input velocity and raise no flag
	move $v0, $a0
	li $v1, 0
	jr $ra

#####################################################################
GROUND_COLLISION:
	# Parameters: $a0: vel.y   $a1: vel.x
	# Return: $v0: new vel.y   $v1: ground collision flag
	bgtz $a0, falling
	move $v0, $a0
	li $v1, 0
	jr $ra
falling:
	la $t0, framebuffer	# address of framebuffer
	li $t1, 0		# height_counter
	li $t2, 0		# width_counter
	move $t3, $a0		# max_height
	li $t4, PLAYER_WIDTH	# max_width
	# Calculate starting position
	lw $t9, player_pos+4	# $t9 = pos.y
	addi $t9, $t9, PLAYER_HEIGHT
	sll $t9, $t9, 9		# $t9 = (pos.y + player_height)*128*4
	addu $t0, $t0, $t9
	lw $t9, player_pos 	# $t9 = pos.x
	sll $t9, $t9, 2		# $t9 = pos.x*4
	addu $t0, $t0, $t9	# St0 = framebuffer + (pos.y + player_height)*128*4 + (player_x)*4 = one pixel below player rect
	# Adjust starting position base on vel.x
	bgez $a1, adjust
	sub $t4, $t4, $a1	# vel.x < 0: max_width -= vel.x
	sll $t9, $a1, 2		#	     starting_pos += vel.x*4
	add $t0, $t0, $t9	#
	j t5
adjust:	add $t4, $t4, $a1	# vel.x >= 0: max_width += vel.x
t5: 	move $t5, $t0
check_loop2:
	bge $t1, $t3, no_ground_collision
inner_loop2:
		bge $t2, $t4, one_pass_2
		# Check collision
		lw $t7, 0($t5)
		bne $t7, BORDER, not_border2
		# Collision found, return new vel.y
		move $v0, $t1
		li $v1, 1
		jr $ra
not_border2:	# If collided pixel is not background, call collision handler
		beq $t7, BACKGROUND, next_p2
		# Store used registers ($a0, $t0, $t1, $t2, $t3, $t4, $t5, $ra)
		addi $sp, $sp, -32
		sw $a0, 0($sp)
		sw $t0, 4($sp)
		sw $t1, 8($sp)
		sw $t2, 12($sp)
		sw $t3, 16($sp)
		sw $t4, 20($sp)
		sw $t5, 24($sp)
		sw $ra, 28($sp)
		# Call other collision handler
		move $a0, $t5
		jal OTHER_COLLISION
		# Restore used registers
		lw $a0, 0($sp)
		lw $t0, 4($sp)
		lw $t1, 8($sp)
		lw $t2, 12($sp)
		lw $t3, 16($sp)
		lw $t4, 20($sp)
		lw $t5, 24($sp)
		lw $ra, 28($sp)
		addi $sp, $sp, 32
		
next_p2: 	# Move to next pixel
		addi $t5, $t5, 4	# 2 pixels to the right
		addi $t2, $t2, 1	#
		j inner_loop2
one_pass_2:
	# Move 1 pixel down from starting position
	addi $t1, $t1, 1	# $t1 = $t1 + 1
	li $t2, 0		# reset value of $t2 to 0
	sll $t7, $t1, 9		# $t7 = $t1*128*4
	addu $t5, $t0, $t7	# $t5 = $t0 + $t7
	j check_loop2
no_ground_collision:
	# Return input velocity and raise no flag
	move $v0, $a0
	li $v1, 0
	jr $ra
#####################################################################
CEIL_COLLISION:
	# Parameters: $a0 = v.y
	# Return: $v0 = new v.y
	bltz $a0, rising
	move $v0, $a0
	jr $ra
rising:
	la $t0, framebuffer	# address of framebuffer
	li $t1, 0		# height_counter
	li $t2, 0		# width_counter
	move $t3, $a0		# min_height
	li $t4, PLAYER_WIDTH	# max_width
	# Calculate starting position
	lw $t9, player_pos+4	# $t9 = pos.y - 1
	subi $t9, $t9, 1
	sll $t9, $t9, 9		# $t9 = (pos.y - 1)*128*4
	addu $t0, $t0, $t9
	lw $t9, player_pos 	# $t9 = pos.x
	sll $t9, $t9, 2		# $t9 = pos.x*4
	addu $t0, $t0, $t9	# St0 = framebuffer + (pos.y - 1)*128*4 + (player_x)*4 = one pixel above player rect
t5_2: 	move $t5, $t0
check_loop3:
	ble $t1, $t3, no_ceiling_collision
inner_loop3:
		bge $t2, $t4, one_pass_3
		# Check collision
		lw $t7, 0($t5)
		bne $t7, BORDER, not_border3
		# Collision found, return new vel.y
		move $v0, $t1
		jr $ra
not_border3:	# If collided pixel is not background, call collision handler
		beq $t7, BACKGROUND, next_p3
		# Store used registers ($a0, $t0, $t1, $t2, $t3, $t4, $t5, $ra)
		addi $sp, $sp, -32
		sw $a0, 0($sp)
		sw $t0, 4($sp)
		sw $t1, 8($sp)
		sw $t2, 12($sp)
		sw $t3, 16($sp)
		sw $t4, 20($sp)
		sw $t5, 24($sp)
		sw $ra, 28($sp)
		# Call other collision handler
		move $a0, $t5
		jal OTHER_COLLISION
		# Restore used registers
		lw $a0, 0($sp)
		lw $t0, 4($sp)
		lw $t1, 8($sp)
		lw $t2, 12($sp)
		lw $t3, 16($sp)
		lw $t4, 20($sp)
		lw $t5, 24($sp)
		lw $ra, 28($sp)
		addi $sp, $sp, 32

next_p3: 	# Move to next pixel
		addi $t5, $t5, 4	# 2 pixels to the right
		addi $t2, $t2, 1	#
		j inner_loop3
one_pass_3:
	# Move 1 pixel up
	subi $t1, $t1, 1	# $t1 = $t1 - 1
	li $t2, 0		# reset value of $t2 to 0
	sll $t7, $t1, 9		# $t7 = $t1*128*4
	addu $t5, $t0, $t7	# $t5 = $t0 + $t7
	j check_loop3
no_ceiling_collision:
	# Return input velocity and raise no flag
	move $v0, $a0
	jr $ra
	
#####################################################################
DRAW_MAP:
	#Parameters: $a0: address to map
	la $t0, framebuffer
	move $t1, $a0
	li $t2, 65536
	add $t2, $t2, $t0	# end memory
	# Get original player positions (the first 2 words)
	lw $t3, 0($t1)	#x
	lw $t4, 4($t1)	#y
	sw $t3, player_pos
	sw $t4, player_pos+4
	addi $t1, $t1, 8
	# Get door position (3rd and 4th words)
	lw $t3, 0($t1)	#x
	lw $t4, 4($t1)	#y
	sw $t3, door_pos
	sw $t4, door_pos+4
	addi $t1, $t1, 8
draw_map_loop:	
	bge $t0, $t2, end_draw_map
	lw $t3, 0($t1)
	sw $t3, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	j draw_map_loop
end_draw_map:
	jr $ra
	
#####################################################################
DRAW_ITEMS:
	la $t1, item_arr+4	
	lw $t2, item_arr	#first word is item count
items_traverse:
	beqz $t2, end_item_draw
	lw $t3, 0($t1)		# y*128 + x
	lw $t4, 4($t1)		# item flag
	# Draw the item
	li $t5, BACKGROUND
	li $t9, 0xff000000
	li $t8, 0
	and $t6, $t4, 0x1 
	beqz $t6, draw_item	# fill item with background color if item is already picked up
	# pick item sprite
	la $t5, coin_sprite	# sprite address
	li $t8, 1		
	lw $t9, item_arr
	sub $t9, $t9, $t2	# current index of item in the array
	sll $t9, $t9, 24	# $t6 = 0x0[index]000000
	addi $t9, $t9, 0xa0000000 # $t6 = 0xa[index]000000 = colour prefix for item at index
draw_item:	
	# Store away $t1, $t2, and $ra
	addi $sp, $sp, -12
	sw $t1, 0($sp)
	sw $t2, 4($sp)
	sw $ra, 8($sp)
	
	# Call draw function
	move $a0, $t3
	li $a1, 0
	li $a2, ITEM_SIZE
	li $a3, ITEM_SIZE
	addi $sp, $sp, -12
	sw $t8, 0($sp)
	sw $t5, 4($sp)
	sw $t9, 8($sp)
	jal DRAW_RECT
	
	# Restore $t1 and $t2
	lw $t1, 0($sp)
	lw $t2, 4($sp)
	lw $ra, 8($sp)
	addi $sp, $sp, 12
	
	# Move to the next item
	addi $t1, $t1, 8
	subi $t2, $t2, 1
	j items_traverse
end_item_draw:
	jr $ra
	
#####################################################################
OTHER_COLLISION:
	# Parameters: $a0: memory location of the pixel (word aligned)
	lw $t9, 0($a0)
	bne $t9, BACKGROUND, lookup_collision_handler
	jr $ra	# the pixel is just background, do nothing
lookup_collision_handler:
	# Store $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)

	# Check for pixel and call correct hanlder
	srl $t8, $t9, 28	# $t8 = the 4 most significant bits
	beq $t8, 0xd, door_collision
	beq $t8, 0xa, item_collision
	j end_handler
	
item_collision:
	# calculate item index from colour
	srl $t8, $t9, 24	# most significant byte (0xa[index])
	sub $a0, $t8, 0xa0	# get 0x0[index]
	jal ITEM_COLLISION_HANDLER
	j end_handler

door_collision:
	lw $t9, objectives
	bgtz $t9, end_handler
	j NEXT_LEVEL
	
end_handler:
	# Load $ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
####################################################################
ITEM_COLLISION_HANDLER:
	# Parater: $a0= index of the item in the array
	# look for collided coin
	la $t0, item_arr+4
	sll $t1, $a0, 3
	add $t0, $t0, $t1	# memory word of the item	

	lw $t3, 4($t0)		# item flag
	# check if item has disappeared
	and $t4, $t3, 1
	beqz $t4, end_item_handler	# if flag is even => item has disappeared
	# check type of item
	srl $t4, $t3, 1
	beq $t4, 0, item_coin
item_coin:	
	lw $t9, objectives
	sub $t9, $t9, 1	        # decrease the number of objectives left
	sw $t9, objectives
	
	# set last bit of item flag to 0 (indicate that item has been grabbed)
	andi $t3, $t3, 0xfffffffe		
	sw $t3, 4($t0)
	# Play coin sound
	li $v0, 31
	li $a2, 2
	li $a3, 80
	li $a0, 88
	li $a1,	250
	syscall
end_item_handler:	
	jr $ra
	
###################################################################
UPDATE_BULLETS:
	la $t0, framebuffer
	la $t1, bullet_arr+4
	lw $t2, bullet_arr
bullet_update_loop:
	beqz $t2, end_bullet_update
	# Update position	
	lw $t3, 0($t1)	# bullet pos
	lw $t4, 4($t1)	# flag
	beqz $t4, skip_bullet		# does not update bullet with 0 flag
	mul $t4, $t4, BULLET_SPEED
	add $t3, $t3, $t4
	sw $t3, 0($t1)
	# Check hitting and update flag
	sll $t3, $t3, 2
	add $t3, $t3, $t0
	lw $t3, 0($t3)			# new bullet position
	beq $t3, BACKGROUND, skip_bullet	# skip if bullet hits nothing
	bne $t3, BORDER, other_bullet_hit	# If bullet hit border
	li $t4, 0	# mark bullet as disappeared
	sw $t4, 4($t1)
	j skip_bullet
other_bullet_hit:
	# Store away registers
	addi $sp, $sp, -16
	sw $t0, 0($sp)
	sw $t1, 4($sp)
	sw $t2, 8($sp)
	sw $ra, 12($sp)
	# Check for other hit object
	srl $t4, $t3, 28	#get 4 most significant bits
	beq $t4, 0xb, hit_enemy
	beq $t4, 0xe, hit_player
	j restore_bullet_update_registers
hit_enemy:
	li $t4, 0	# mark bullet as disappeared
	sw $t4, 4($t1)	#
	# Play hit sound
	
	# get enemy index
	srl $t4, $t3, 24
	sub $a0, $t4, 0xb0
	li $a1, 0
	jal ENEMY_COLLISION_HANDLER
	j restore_bullet_update_registers
hit_player:
	bgtz $s1, restore_bullet_update_registers
	li $t4, 0	# mark bullet as disappeared
	sw $t4, 4($t1)	#
	j PLAYER_KILLED

restore_bullet_update_registers:
	lw $t0, 0($sp)
	lw $t1, 4($sp)
	lw $t2, 8($sp)
	lw $ra, 12($sp)
	addi $sp, $sp, 16

skip_bullet:	
	addi $t1, $t1, 8
	sub $t2, $t2, 1
	j bullet_update_loop
end_bullet_update:
	jr $ra
	
###################################################################
DRAW_BULLETS:
	# Parameters: $a0: bullet color
	la $t0, framebuffer
	la $t1, bullet_arr+4
	lw $t2, bullet_arr
bullet_draw_loop:
	beqz $t2, end_bullet_draw
	lw $t3, 0($t1)
	sll $t3, $t3, 2
	add $t3, $t3, $t0	# new position of the bullet in the framebuffer
	sw $a0, 0($t3)
	addi $t1, $t1, 8
	sub $t2, $t2, 1
	j bullet_draw_loop
end_bullet_draw:
	jr $ra
	
####################################################################
DELETE_BULLETS:
	la $t0, bullet_arr+4	# tr
	move $t1, $t0		# pr
	lw $t2, bullet_arr	# iterator
	move $t3, $t2		# new_count
bullet_delete_loop:
	beqz $t2, end_bullet_delete
	# Get bullet data from tr
	lw $t4, 0($t0)	# pos
	lw $t5, 4($t0)	# flag
	bnez $t5, bullet_not_deleted
	addi $t0, $t0, 8	# increments tr
	sub $t2, $t2, 1
	sub $t3, $t3, 1		# decrement new_count
	j bullet_delete_loop
bullet_not_deleted:
	sw $t4, 0($t1)		# copy bullet from tr to pr
	sw $t5, 4($t1)
	addi $t0, $t0, 8	# increments tr and pr
	addi $t1, $t1, 8
	sub $t2, $t2, 1
	j bullet_delete_loop
end_bullet_delete:
	# store new bullet count
	sw $t3, bullet_arr
	jr $ra
	
####################################################################
ADD_BULLET:
	# Parameters: $a0: bullet position (x + y*128)	$a1: bullet flag
	la $t0, bullet_arr+4
	lw $t1, bullet_arr
add_bullet_loop:
	beqz $t1, new_bullet_index
	addi $t0, $t0, 8
	sub $t1, $t1, 1
	j add_bullet_loop
new_bullet_index:
	sw $a0, 0($t0)
	sw $a1, 4($t0)
	lw $t1, bullet_arr
	addi $t1, $t1, 1
	sw $t1, bullet_arr
	jr $ra

####################################################################
DRAW_ENEMIES:
	la $t0, framebuffer
	la $t1, enemy_arr+4
	lw $t2, enemy_arr
enemy_draw_loop:
	beqz $t2, end_draw_enemy_loop
	lw $t3, 0($t1)		# enemy position
	lw $t4, 4($t1)		# enemy flag
	
	li $t5, BACKGROUND
	li $t8, 0
	li $t9, 0xff000000
	and $t6, $t4, 1
	beqz $t6, draw_enemy
	sub $t4, $t4, 1
	sll $t4, $t4, 7
	la $t5, enemy_sprite
	add $t5, $t5, $t4
	li $t8, 1	
	lw $t9, enemy_arr
	sub $t9, $t9, $t2	# current index of item in the array
	sll $t9, $t9, 24	# $t9 = 0x0[index]000000
	addi $t9, $t9, 0xb0000000 # $t9 = 0xb[index]000000 = colour prefix for enemy at index
draw_enemy:
	# Store away $t1, $t2, and $ra
	addi $sp, $sp, -12
	sw $t1, 0($sp)
	sw $t2, 4($sp)
	sw $ra, 8($sp)
	
	# Call draw function
	move $a0, $t3
	li $a1, 0
	li $a2, ENEMY_SIZE
	li $a3, ENEMY_SIZE
	addi $sp, $sp, -12
	sw $t8, 0($sp)
	sw $t5, 4($sp)
	sw $t9, 8($sp)
	jal DRAW_RECT
	
	# Restore $t1 and $t2
	lw $t1, 0($sp)
	lw $t2, 4($sp)
	lw $ra, 8($sp)
	addi $sp, $sp, 12
	
	# Move to the next enemy
	addi $t1, $t1, 12
	subi $t2, $t2, 1
	j enemy_draw_loop
end_draw_enemy_loop:
	jr $ra
	
####################################################################
ENEMY_COLLISION_HANDLER:
	# Parameters: $a0: enemy index 	$a1: item collided with (0: bullet; 1: player)
	la $t0, enemy_arr+4
	mul $t1, $a0, 12
	add $t0, $t0, $t1
	# If collided with is a player, reduce lives (might be add)
	
	lw $t2, 4($t0)
	and $t3, $t2, 1
	beqz $t3, skip_enemy	# enemy is already killed -> skip
	andi $t2, $t2, 0xfffffffe
	sw $t2, 4($t0)
	# Play enemy hit sound
	li $v0, 31
	li $a2, 36	# instrument
	li $a3, 80
	li $a0, 30
	li $a1,	75
	syscall
skip_enemy:
	jr $ra

####################################################################
ENEMY_SHOOT:
	lw $t0, enemy_arr
	la $t1, enemy_arr+4
	addi $sp, $sp, -4
	sw $ra, 0($sp)
enemy_shoot_loop:
	beqz $t0, end_enemy_shoot
	lw $t2, 4($t1)	# enemy flag
	andi $t3, $t2, 1
	beqz $t3, next_enemy_shoot
	lw $t3, 8($t1)	# shoot timer
	bgtz $t3, enemy_not_shoot
	# Shoot a bullet when timer = 0
	lw $a0, 0($t1)
	srl $a1, $t2, 1
	beqz $a1, enemy_shoot_left	# Shooting right (a1 = 1)
		addi $a0, $a0, BULLET_ENEMY_RIGHT
		j enemy_shoot
	enemy_shoot_left:		# Shooting left  (t4 = 0)
		addi $a0, $a0, BULLET_ENEMY_LEFT
		li $a1, -1
enemy_shoot:
	li $t3, ENEMY_SHOOT_TIMER
	sw $t3, 8($t1)
	# preserve current registers
	addi $sp, $sp, -8
	sw $t0, 0($sp)
	sw $t1, 4($sp)
	jal ADD_BULLET
	# restore current registers
	lw $t0, 0($sp)
	lw $t1, 4($sp)
	addi $sp, $sp, 8
	
	j next_enemy_shoot
enemy_not_shoot:
	# Decrement shoot timer
	sub $t3, $t3, 1
	sw $t3, 8($t1)
next_enemy_shoot:
	addi $t1, $t1, 12
	sub $t0, $t0, 1
	j enemy_shoot_loop
end_enemy_shoot:
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
####################################################################
NEXT_LEVEL:
	# Draw winning screen
	la $a0, winning_screen
	jal DRAW_MAP
	lw $t9, player_lives
	addi $a0, $t9, -1
	li $a1, 6989
	jal UPDATE_DISPLAY
	# Play winning sound effect
	li $v0, 33
	li $a2, 126
	li $a3, 80
	li $a0, 60
	li $a1,	2000
	syscall
	# Move to next level (might be added)
	
	j menu
####################################################################
PLAYER_KILLED:
	# Play player hit sound
	li $v0, 33
	li $a2, 2
	li $a3, 80
	li $a0, 48
	li $a1,	150
	syscall
	li $a0, 42
	li $a1,	250
	syscall
	# Subtrac player lives
	lw $t9, player_lives
	addi $t9, $t9, -1
	sw $t9, player_lives
	beqz $t9, PLAYER_DIED	# jump if player has no life left
	# Update lives display
	addi $a0, $t9, -1
	li $a1, 0
	jal UPDATE_DISPLAY
	j respawn
####################################################################
PLAYER_DIED:
	la $a0, game_over_screen
	jal DRAW_MAP
	# Sleep
	li $v0, 32
	li $a0, 5000
	syscall
	j MAIN
####################################################################
UPDATE_DISPLAY:
	mul $a0, $a0, 432
	li $t7, 1
	la $t8, display_counter
	add $t8, $t8, $a0
	li $t9, 0
	# Store old $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	move $a0, $a1
	li $a1, 0
	li $a2, DISPLAY_WIDTH
	li $a3, DISPLAY_HEIGHT
	addi $sp, $sp, -12
	sw $t7, 0($sp)
	sw $t8, 4($sp)
	sw $t9, 8($sp)
	jal DRAW_RECT
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
